import React from 'react';
// import "./NavBar.css";
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, NavItem } from 'reactstrap';
import logo from './images/MusicMatchLogoWhiteSmall.png';


function NavBar() {

  return (
    <div classNmae="justify-content-center">
      <Navbar expand="md" className="justify-content-center">
        <NavLink exact to="/" className="justify-content-center">
        </NavLink>

        <Nav className="ml-auto" navbar>

          <NavItem className="justify-content-center">
            <NavLink to="/"><a className="justify-content-center"><img src={logo} className="justify-content-center"></img></a></NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/">Logout</NavLink>
          </NavItem>
          {/* <NavItem>
            <NavLink to="/favorites">Favorites</NavLink>
          </NavItem> */}

        </Nav>
      </Navbar>
    </div >
  );
}

export default NavBar;
